import React, { useState } from 'react';
import axios from 'axios';

export default function PrediccionReserva() {
  const [formData, setFormData] = useState({
    numAdultos: 2,
    numNinos: 0,
    tipoHabitacion: 'Doble',
    precioHabitacion: 150,
    duracionEstadia: 3,
    diaSemanaCheckIn: 'Monday',
    mesCheckIn: 4,
    antiguedadReserva: 30
  });

  const [resultado, setResultado] = useState(null);
  const [cargando, setCargando] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setCargando(true);
    setResultado(null);

    try {
      const res = await axios.post('http://localhost:8080/api/prediccion', formData);
      setResultado(res.data);
    } catch (err) {
      console.error('Error en la predicción', err);
      setResultado('Error al conectar con el servidor.');
    } finally {
      setCargando(false);
    }
  };

  return (
    <div className="max-w-xl mx-auto px-6 py-10">
      <h1 className="text-2xl font-bold text-center mb-8">
        🔍 Predicción de Cancelación de Reserva
      </h1>

      <form onSubmit={handleSubmit} className="space-y-6">
        {[
          { label: 'Número de Adultos', name: 'numAdultos' },
          { label: 'Número de Niños', name: 'numNinos' },
          { label: 'Precio de la Habitación ($)', name: 'precioHabitacion' },
          { label: 'Duración de la Estadía (días)', name: 'duracionEstadia' },
          { label: 'Mes del Check-in (1-12)', name: 'mesCheckIn' },
          { label: 'Antigüedad de la Reserva (días)', name: 'antiguedadReserva' }
        ].map(({ label, name }) => (
          <div key={name}>
            <label className="block font-medium mb-1">{label}</label>
            <input
              type="number"
              name={name}
              value={formData[name]}
              onChange={handleChange}
              className="w-full p-2 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-teal-500"
            />
          </div>
        ))}

        <div>
          <label className="block font-medium mb-1">Tipo de Habitación</label>
          <select
            name="tipoHabitacion"
            value={formData.tipoHabitacion}
            onChange={handleChange}
            className="w-full p-2 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-teal-500"
          >
            <option value="Suite">Suite</option>
            <option value="Doble">Doble</option>
            <option value="Simple">Simple</option>
          </select>
        </div>

        <div>
          <label className="block font-medium mb-1">Día de la Semana del Check-in</label>
          <select
            name="diaSemanaCheckIn"
            value={formData.diaSemanaCheckIn}
            onChange={handleChange}
            className="w-full p-2 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-teal-500"
          >
            <option>Monday</option>
            <option>Tuesday</option>
            <option>Wednesday</option>
            <option>Thursday</option>
            <option>Friday</option>
            <option>Saturday</option>
            <option>Sunday</option>
          </select>
        </div>

        <div className="flex justify-center">
          <button
            type="submit"
            className="bg-teal-700 text-white px-6 py-2 text-sm rounded-full hover:bg-teal-800 transition-all disabled:opacity-50"
            disabled={cargando}
          >
            {cargando ? (
              <span className="flex items-center space-x-2">
                <svg className="animate-spin h-4 w-4 mr-1 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                  <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                  <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v8H4z"></path>
                </svg>
                <span>Prediciendo...</span>
              </span>
            ) : (
              'Predecir'
            )}
          </button>
        </div>
      </form>

      {resultado && (
        <div className="mt-10 text-center bg-gray-100 p-4 rounded-lg shadow-md">
          <h2 className="text-lg font-semibold mb-2">Resultado:</h2>
          <p className="text-xl">
            {resultado === 'Si' ? (
              <span className="text-red-600">❌ La reserva probablemente será cancelada</span>
            ) : (
              <span className="text-green-700">✅ La reserva probablemente se mantendrá</span>
            )}
          </p>
        </div>
      )}
    </div>
  );
}
